import { createRoot }  from "react-dom/client"
import { useState } from "react"

const MainComponent = () => {
    return (
        <div>
            {/* Encapsulating everything, hope nothing breaks. */}
            <nav class="nav-bar">
                <a class="nav-item" id="current-page" href="index.html">Home Page</a>
                <a class="nav-item" href="about.html">About Page</a>
                <a class="nav-item" href="portfolio.html">Portfolio</a>
            </nav>

            {/* Main content of the page. */}
            <div class="home-content">
                <div class="home-message">
                    <h1 class="home-line"> Hello.</h1>
                    <h4 class="home-line"> My name's Emanuel. Welcome to my website. </h4>
                    <p class="home-line"> Here are some useful links to stuff I'll use a lot during my time with Fullstack.</p>
                </div>
                <div class="link-section">

                </div>
            </div>
                {/* My link's section. */}
        </div>
    )
}

let appEle = document.getElementById("app");
let root = createRoot(appEle);
root.render(<MainComponent/>)
